(157627, '8AC5B388-6B12-4AC7-A510-0D05C1486689', 'I actually don''t think the first trimester has been so bad. I''ve thrown up about 6 times in total and figured out how to eat to get ahead of the nausea most of the time. I think most women have it much worse. So I really don''t have many complaints. It just feels bad to gain weight earlier than most other people do. ', 'Nitzan', 'David', '2016-05-18T06:56:21'),
