(157630, 'FB8186ED-F299-4E07-B768-56D705EFD140', 'Hi sweets. I''m going into the Bart station now. Nathan decided this morning that he didn''t want to eat breakfast or pack a lunch. I stayed strong and told him both of those things weren''t options. He screamed and cried a bunch...but he did eat a yogurt about 1 minute before we left the house. ', 'Nitzan', 'David', '2016-05-19T08:45:19'),
