(157340, '428D2133-6D30-4B61-8289-96F79B71006E', 'I''m at the car wash and they said it''s going to take them an hour to get the gummies out. So I may not be home until around 3:30. Thankfully I have my kindle so I can read. ', 'Nitzan', 'David', '2016-05-21T14:06:46'),
