(157414, '99413A85-E548-4A6C-AC71-1BB400B356F0', 'Hi baby, hope you had a good meeting. Just thinking how happy I am every day to wake up with you, share some lazy time, bring you a smoothie, talk about the news. These little things of being together....just good to reflect in the midst of our busy days. ', 'David', 'Nitzan', '2016-05-23T10:41:16'),
(157458, 'EBEA9C71-F48D-4A83-889D-F178F9903AFA', 'I love the reflection. Last night I was with my friend Pauline and she was sharing the continued nightmare stories of how hard dating is for kickass woman. I always feel so lucky when I hear those stories because I found someone so perfect for me. ', 'Nitzan', 'David', '2016-05-23T11:46:07'),
